class BrokerUser:
    def __init__(self):
        self.validation_rules = {}
        self.records = []

    def upload_error_messages(self, error_messages):
        for message in error_messages:
            if message["code"] not in self.validation_rules:
                self.validation_rules[message["code"]] = message["description"]
            else:
                print(f"Error code {message['code']} already exists.")

    def submit_records(self, records):
        self.records.extend(records)
        print("Records submitted successfully.")

    def update_validation_rules(self, new_rules):
        self.validation_rules.update(new_rules)


class FABSUser:
    def __init__(self):
        self.fabs_files = {}

    def submit_fabs_files(self, file_name, file_data):
        self.fabs_files[file_name] = file_data
        print("FABS file submitted successfully.")

    def download_fabs_files(self, file_name):
        if file_name in self.fabs_files:
            return self.fabs_files[file_name]
        else:
            print("FABS file not found.")


class Developer:
    def __init__(self):
        self.broker_validation_rules = {}
        self.gtas_window_data = []
        self.d_files_generation_requests = []

    def update_broker_validation_rule_table(self, new_rules):
        self.broker_validation_rules.update(new_rules)

    def add_gtas_window_data(self, data):
        self.gtas_window_data.extend(data)

    def manage_d_files_generation_requests(self, requests):
        self.d_files_generation_requests.extend(requests)


class DataUser:
    def __init__(self):
        self.raw_agency_published_files = {}

    def access_raw_agency_published_files(self, file_name):
        if file_name in self.raw_agency_published_files:
            return self.raw_agency_published_files[file_name]
        else:
            print("File not found.")

    def upload_raw_agency_published_files(self, file_name, file_data):
        self.raw_agency_published_files[file_name] = file_data
        print("File uploaded successfully.")


class UIDesigner:
    def __init__(self):
        self.resources_page = {}
        self.agency_reports = {}

    def redesign_resources_page(self, new_design):
        self.resources_page = new_design

    def report_to_agencies(self, agency_name, report_data):
        if agency_name not in self.agency_reports:
            self.agency_reports[agency_name] = []
        self.agency_reports[agency_name].append(report_data)


def main():
    broker_user = BrokerUser()
    error_messages = [
        {"code": "E001", "description": "Invalid data format"},
        {"code": "E002", "description": "Missing required fields"},
    ]
    broker_user.upload_error_messages(error_messages)
    broker_user.submit_records([{"id": 1, "data": "sample data"}])

    fabs_user = FABSUser()
    fabs_user.submit_fabs_files("file1", "sample file data")
    print(fabs_user.download_fabs_files("file1"))

    developer = Developer()
    new_rules = {"E003": "New error message"}
    developer.update_broker_validation_rule_table(new_rules)
    developer.add_gtas_window_data([{"id": 1, "data": "sample data"}])
    developer.manage_d_files_generation_requests([{"id": 1, "request": "sample request"}])

    data_user = DataUser()
    data_user.upload_raw_agency_published_files("file1", "sample file data")
    print(data_user.access_raw_agency_published_files("file1"))

    ui_designer = UIDesigner()
    new_design = {"layout": "new layout"}
    ui_designer.redesign_resources_page(new_design)
    ui_designer.report_to_agencies("agency1", {"id": 1, "data": "sample report data"})


if __name__ == "__main__":
    main()
